const coinListDataUtils = {
    marketNames: (names) => {
        const data = {};

        console.log(names);
        names.forEach(name => {
            /*if (name.market.split("-")[0] !== "KRW")
                data[name.market] = {
                    korean: name.korean_name
                };*/
            let shortSym = name.market.split("-")[1];

            for (let checkSym of data[shortSym]) {
                console.log(checkSym);
            }

            data[shortSym] = {
                upbitSym: name.market
            }
        });

        return data;
    },
};

export {
    coinListDataUtils
}
